It’s estimated that, on average, we spend ~2.5 hours on social media every day (this is VERY conservative for me 😅) but it’s mind-boggling to quantify the amount of time we spend online vs. in the real world. This stat is so important to remember when it comes to building our village – historically, we would be physically surrounded by the wisdom and experience of our elders, by a community that influences and shapes our worldview. Now, along with the physical, we have the digital world to consider. We’re made up of all the people we’ve known, all the people we interact with, and the same goes for who we spend our time with online. I’m so grateful for the inspiring women I’ve found across social, like @whitehairwisdom, who give me a broader perspective on life and aging and relationships after 25 🤌🏻 

